import React from "react";

function RecipeCard(props) {
  return (
    <div>
      <h2>
        Recipe Name:{props.recipeName}
        </h2>
        <ul>
          <li>
          </li>
          <li>
            <strong>Ingredients:</strong> {props.ingredients}
          </li>
          <li>
            <strong>Directions:</strong> {props.directions}
          </li>
        </ul>
    </div>
  );
}

export default RecipeCard;
